import React from "react";

const Customers = props => {
    return (
      <div
        style={{
          display: 'flex',
          justifyContent: 'center',
          alignItems: 'center',
          height: '90vh'
        }}>
        <h1 >Customer</h1>
      </div>
    );
  };
  
  export default Customers;
